import React, { Component } from "react";
import AOS from "aos";
import "aos/dist/aos.css";
import Container from "../Styles/Container.css";
import JobCard from "../Styles/JobCard.css";
import wsib from "../Images/wsib.png";

export default class Experience extends React.Component {
  constructor(props) {
    super(props);
    this.state = { height: props.height, width: props.width };
  }

  componentWillReceiveProps(nextProps) {
    if (nextProps.height !== this.state.height) {
      this.setState({ height: nextProps.height });
    }
    if (nextProps.width !== this.state.width) {
      this.setState({ width: nextProps.width });
    }
  }

  render() {
    {
      AOS.init();
    }
    return (
      <div
        style={{
          //marginTop: this.state.height / 8,
          height: this.state.height / 1.5,
          width: this.state.width,
          overflow: "scroll",
          backgroundColor: "red"
        }}
      >
        <div
          style={{
            position: "sticky",
            //position: "-webkit-sticky",
            top: "0px"
            //marginLeft: "40%",
            // width: "75%",
            // left: "50%",
            // marginLeft: "-37.5%"
            //marginTop: "-50%"
          }}
          className="text"
          data-aos="fade-down"
          data-aos-easing="linear"
          data-aos-duration="100"
          data-aos-anchor-placement="top-center"
          //data-aos-offset="-100"
        >
          My Job Experiences
        </div>

        <center>
          <div
            style={{
              //height: this.state.height / 2.85,
              //width: this.state.width,
              marginTop: 100
              //backgroundColor: "red",
              //overflow: "scroll"
            }}
          >
            <div
              className="main"
              style={{
                height: this.state.height / 3,
                width: this.state.width / 2.3,
                marginRight: this.state.width / 2,
                marginBottom: 100
              }}
            >
              <div
                className="picture"
                style={{
                  width: this.state.width / 6,
                  height: this.state.height / 3
                }}
              >
                <img
                  src={wsib}
                  height={this.state.height / 3.5}
                  width={this.state.width / 6.5}
                  style={{
                    borderStyle: "solid",
                    borderRadius: "10%",
                    marginTop: "5%"
                  }}
                />
              </div>
              <div>Hello World</div>
            </div>
            <div
              className="main"
              style={{
                height: this.state.height / 3,
                width: this.state.width / 2.3,
                marginLeft: this.state.width / 2,
                marginBottom: 100
              }}
            />
            <div
              className="main"
              style={{
                height: this.state.height / 3,
                width: this.state.width / 2.3,
                marginRight: this.state.width / 2,
                marginBottom: this.state.height / 2
              }}
            />
          </div>
        </center>
      </div>
    );
  }
}
